import React from "react";

const Card = ({ location, image }) => {
  return (
    <div class="card">
      <div class="card-image">
        <img
          style={{
            objectFit: "cover",
          }}
          src={image}
          alt=""
        />
      </div>
      <div class="category"> Illustration </div>
      <div class="heading">{location}</div>
    </div>
  );
};

export default Card;
